import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeDataset, setActiveDataset] = useState(0);
  const [hoverPoint, setHoverPoint] = useState(null);

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveDataset(prev => (prev + 1) % 3);
    }, 3000);
    return () => clearInterval(timer);
  }, []);

  // Generate random data points
  const generateDataPoints = (count, variance) => {
    return Array.from({ length: count }, (_, i) => ({
      x: i * (100 / count),
      y: 50 + Math.sin(i * 0.5) * 20 + Math.random() * variance,
    }));
  };

  const datasets = [
    generateDataPoints(12, 10),
    generateDataPoints(12, 15),
    generateDataPoints(12, 20),
  ];

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      background: '#1a1a2e',
      borderRadius: '20px',
      padding: '30px',
      overflow: 'hidden',
    }}>
      {/* Main Graph Area */}
      <div style={{
        position: 'relative',
        width: '100%',
        height: '300px',
        backgroundColor: 'rgba(255, 255, 255, 0.03)',
        borderRadius: '15px',
        padding: '20px',
        marginBottom: '20px',
      }}>
        {/* Graph Title */}
        <div style={{
          color: '#fff',
          fontSize: '16px',
          marginBottom: '20px',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
        }}>
          <span>Model Performance Metrics</span>
          <div style={{
            display: 'flex',
            gap: '10px',
          }}>
            {['Accuracy', 'Loss', 'Validation'].map((metric, i) => (
              <span
                key={i}
                style={{
                  color: i === activeDataset ? '#4CAF50' : '#666',
                  fontSize: '14px',
                  cursor: 'pointer',
                }}
                onClick={() => setActiveDataset(i)}
              >
                {metric}
              </span>
            ))}
          </div>
        </div>

        {/* Graph Grid */}
        <svg width="100%" height="200px" style={{ overflow: 'visible' }}>
          {/* Grid Lines */}
          {[0, 1, 2, 3, 4].map((i) => (
            <line
              key={`grid-${i}`}
              x1="0"
              y1={i * 50}
              x2="100%"
              y2={i * 50}
              stroke="#333"
              strokeWidth="1"
              strokeDasharray="4"
            />
          ))}

          {/* Data Line */}
          <path
            d={`M ${datasets[activeDataset]
              .map((point, i) => `${i === 0 ? 'M' : 'L'} ${point.x * 5} ${point.y}`)
              .join(' ')}`}
            fill="none"
            stroke="#4CAF50"
            strokeWidth="2"
            style={{
              animation: 'drawLine 1s ease-out forwards',
            }}
          />

          {/* Data Points */}
          {datasets[activeDataset].map((point, i) => (
            <circle
              key={i}
              cx={point.x * 5}
              cy={point.y}
              r="4"
              fill="#4CAF50"
              stroke="#fff"
              strokeWidth="2"
              onMouseEnter={() => setHoverPoint(i)}
              onMouseLeave={() => setHoverPoint(null)}
              style={{
                cursor: 'pointer',
                transition: 'all 0.3s ease',
                transform: hoverPoint === i ? 'scale(1.5)' : 'scale(1)',
              }}
            />
          ))}
        </svg>
      </div>

      {/* Statistics Cards */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gap: '20px',
        marginBottom: '20px',
      }}>
        {[
          { label: 'Accuracy', value: '94.8%', trend: '+2.3%' },
          { label: 'F1 Score', value: '0.92', trend: '+0.04' },
          { label: 'Loss', value: '0.086', trend: '-0.012' },
        ].map((stat, i) => (
          <div
            key={i}
            style={{
              backgroundColor: 'rgba(255, 255, 255, 0.03)',
              padding: '15px',
              borderRadius: '10px',
              border: '1px solid rgba(255, 255, 255, 0.05)',
            }}
          >
            <div style={{ color: '#666', fontSize: '14px' }}>{stat.label}</div>
            <div style={{
              color: '#fff',
              fontSize: '24px',
              marginTop: '5px',
              display: 'flex',
              alignItems: 'center',
              gap: '10px',
            }}>
              {stat.value}
              <span style={{
                fontSize: '14px',
                color: stat.trend.startsWith('+') ? '#4CAF50' : '#f44336',
              }}>
                {stat.trend}
              </span>
            </div>
          </div>
        ))}
      </div>

      {/* Feature Importance */}
      <div style={{
        backgroundColor: 'rgba(255, 255, 255, 0.03)',
        padding: '20px',
        borderRadius: '15px',
      }}>
        <div style={{ color: '#fff', marginBottom: '15px' }}>Feature Importance</div>
        {[
          { name: 'Text Length', value: 0.85 },
          { name: 'Sentiment Score', value: 0.72 },
          { name: 'Entity Count', value: 0.64 },
        ].map((feature, i) => (
          <div
            key={i}
            style={{
              display: 'flex',
              alignItems: 'center',
              marginBottom: '10px',
              gap: '10px',
            }}
          >
            <div style={{ color: '#666', width: '120px' }}>{feature.name}</div>
            <div style={{
              flex: 1,
              height: '8px',
              backgroundColor: '#333',
              borderRadius: '4px',
              overflow: 'hidden',
            }}>
              <div
                style={{
                  width: `${feature.value * 100}%`,
                  height: '100%',
                  backgroundColor: '#4CAF50',
                  animation: 'growWidth 1s ease-out',
                }}
              />
            </div>
            <div style={{ color: '#fff', width: '50px' }}>
              {(feature.value * 100).toFixed(0)}%
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AIVisual;
